const l=JSON.parse('{"key":"v-fc004520","path":"/posts/notes/db_notes/database_notes.html","title":"数据管理基础-课程笔记","lang":"zh-CN","frontmatter":{"title":"数据管理基础-课程笔记","author":"Neonscape","image":"/assets/imgs/bgs/30.png","cover":"/assets/imgs/bgs/31.png","index":true,"date":"2023-03-21T00:00:00.000Z","icon":"book","article":true,"category":["notes"],"tag":["database"]},"headers":[{"level":2,"title":"数据库","slug":"数据库","link":"#数据库","children":[{"level":3,"title":"数据库概论","slug":"数据库概论","link":"#数据库概论","children":[]},{"level":3,"title":"信息世界中的基本概念","slug":"信息世界中的基本概念","link":"#信息世界中的基本概念","children":[]},{"level":3,"title":"数据模型的组成","slug":"数据模型的组成","link":"#数据模型的组成","children":[]},{"level":3,"title":"常用的数据模型","slug":"常用的数据模型","link":"#常用的数据模型","children":[]},{"level":3,"title":"数据库的三级模式","slug":"数据库的三级模式","link":"#数据库的三级模式","children":[]}]}],"git":{"createdTime":1711028588000,"updatedTime":1719158693000,"contributors":[{"name":"Neonscape","email":"neonscapemail@gmail.com","commits":2}]},"readingTime":{"minutes":9.43,"words":2828},"filePathRelative":"posts/notes/db_notes/database_notes.md","localizedDate":"2023年3月21日","excerpt":"<h2> 数据库</h2>\\n<h3> 数据库概论</h3>\\n<h4> 四个基本概念</h4>\\n<ul>\\n<li>数据\\n<ul>\\n<li>具有一定的<strong>语义</strong>（对代表数据的符号串的规则解释）含义、可以被记录下来的已知信息被称为<strong>数据</strong>。</li>\\n<li>信息是数据的内涵，数据是信息的载体。</li>\\n</ul>\\n</li>\\n<li>数据库\\n<ul>\\n<li>长期储存在计算机内、有组织、可共享的大量数据的集合。</li>\\n<li>按一定的数据模型组织、描述和储存，具有较小的数据冗余，较高的数据独立性和易扩展性。</li>\\n</ul>\\n</li>\\n<li>数据库管理系统\\n<ul>\\n<li>位于用户和数据库之间的一层数据管理软件；</li>\\n<li>提供数据的定义、组织，存储、管理和操纵。</li>\\n<li>负责数据库的事务和运行管理、数据库的建立和维护。</li>\\n</ul>\\n</li>\\n<li>数据库系统\\n<ul>\\n<li>由数据库、数据库管理系统、数据库管理员和支撑系统运行的软件和硬件组成。</li>\\n</ul>\\n</li>\\n<li>数据库应用系统\\n<ul>\\n<li>由数据库系统、应用开发工具、应用系统和数据库用户组成的计算机系统。</li>\\n</ul>\\n</li>\\n</ul>"}');export{l as data};
